import React from "react";

function Pricing() {
  return (
    <section
      style={{
        padding: "48px 0",
        color: "#222",
        fontFamily: '"Inter","Segoe UI",Roboto,Arial,sans-serif',
      }}
    >
      <div className="container">
        <div className="row align-items-center">
          {/* Left column */}
          <div className="col-lg-4 col-md-5">
            <h2
              style={{
                fontSize: "48px",
                lineHeight: "1.02",
                marginBottom: "18px",
                fontWeight: 700,
                color: "#222",
              }}
            >
              Unbeatable pricing
            </h2>

            <p
              style={{
                maxWidth: "420px",
                fontSize: "18px",
                lineHeight: "1.7",
                color: "#444",
                marginBottom: "18px",
              }}
            >
              We pioneered the concept of discount broking and price
              transparency in India. Flat fees and no hidden charges.
            </p>

            <a
              href="#"
              style={{
                color: "#2b74ff",
                textDecoration: "none",
                fontWeight: 500,
                display: "inline-flex",
                alignItems: "center",
                gap: "8px",
              }}
            >
              See pricing{" "}
              <i className="fa fa-long-arrow-right" aria-hidden="true" />
            </a>
          </div>

          {/* Right column */}
          <div className="col-lg-8 col-md-7">
            <div
              style={{
                display: "flex",
                justifyContent: "flex-end",
                alignItems: "center",
                gap: "48px",
                overflowX: "auto",
                paddingTop: "8px",
              }}
            >
              {/* Feature 1 */}
              <div
                style={{
                  display: "flex",
                  alignItems: "center",
                  gap: "18px",
                  minWidth: "220px",
                }}
              >
                <img
                  src="media/images/pricing01.svg"
                  alt="zero rupee"
                  style={{
                    width: "92px",
                    height: "auto",
                    flexShrink: 0,
                  }}
                />
                <p
                  style={{
                    margin: 0,
                    fontSize: "14px",
                    lineHeight: "1.35",
                    color: "#333",
                    fontWeight: 500,
                    maxWidth: "220px",
                  }}
                >
                  Free account opening
                </p>
              </div>

              {/* Feature 2 */}
              <div
                style={{
                  display: "flex",
                  alignItems: "center",
                  gap: "18px",
                  minWidth: "220px",
                }}
              >
                <img
                  src="media/images/pricing02.svg"
                  alt="zero rupee 2"
                  style={{
                    width: "92px",
                    height: "auto",
                    flexShrink: 0,
                  }}
                />
                <p
                  style={{
                    margin: 0,
                    fontSize: "14px",
                    lineHeight: "1.35",
                    color: "#333",
                    fontWeight: 500,
                    maxWidth: "220px",
                  }}
                >
                  Free equity delivery and direct mutual funds
                </p>
              </div>

              {/* Feature 3 */}
              <div
                style={{
                  display: "flex",
                  alignItems: "center",
                  gap: "18px",
                  minWidth: "220px",
                }}
              >
                <img
                  src="media/images/pricing20.svg"
                  alt="20 rupee"
                  style={{
                    width: "92px",
                    height: "auto",
                    flexShrink: 0,
                  }}
                />
                <p
                  style={{
                    margin: 0,
                    fontSize: "14px",
                    lineHeight: "1.35",
                    color: "#333",
                    fontWeight: 500,
                    maxWidth: "220px",
                  }}
                >
                  Intraday and F&amp;O
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Pricing;
